#include <bits/stdc++.h>using namespace std; bitset<1005> b;vector<int> primes;int number;void sieve(){	b.set();	b[0]=b[1]=0;	for(int i=2;i<=number;i++)	{		if(b[i])		{			primes.push_back(i);			for(int j=i*i;j<=number;j+=i)			{				b[j]=0;			}		}	}} int main(){	number=100;	sieve();	int count=0;	string s;	for(int i=0;i<15;i++)	{		cout<<primes[i]<<endl;		cout<<flush;		cin>>s;		if(s=="yes")		{			count++;			if(count==1 and primes[i]*primes[i]<=100)			{				cout<<primes[i]*primes[i]<<endl;				cin>>s;				if(s=="yes")				{					count++;					break;				}			}		}		if(count>=2)		{			break;		}	}	if(count>=2)	{		cout<<"composite";	}	else	{		cout<<"prime";	}		return 0;}
